import imageone from '../images/imageone.jpg';
import imagetwo from '../images/imagetwo.jpg';
import imagethree from '../images/imagethree.jpg';

export const SliderData = [
    {
        title: 'In all things do it with love',
        message: 'if it is kreative, we embrace it',
        path: '/blogs',
        label: 'View Hwan',
        image: imageone,
        alt: 'Child'
    },

    {
        title: 'In all things do it with love',
        message: 'if it is kreative, we embrace it',
        path: '/blogs',
        label: 'View Hwan',
        image: imagetwo,
        alt: 'Child'
    },
    {
        title: 'In all things do it with love',
        message: 'if it is kreative, we embrace it',
        path: '/blogs',
        label: 'View Hwan',
        image: imagethree,
        alt: 'Child'
    },
    
];
